void Tree::inorderTraversal(Node* node){

	// Another Recursive Process
	if (node == nullptr) {
		return;
	}

	inorderTraversal(node->left);
	std::cout << node->data << " ";
	inorderTraversal(node->right);
	return; 
}

void Tree::inorderTraversalWrapper(){
	inorderTraversal(root);
	return;
}

void Tree::insert(int touch_value, Node*& curr){
	// If their is no root, then update that first
	// Better if I have a special memory address instread

	// base case
	if(!curr){
		//std::cout << touch_value << '\n';
		curr = new Node(touch_value);
		//std::cout << curr->data == root->data << std::endl;
		// Make sure they are not equal
		this->curr = root;
		return; 
	}
	
	// Recursion
	
	if(curr->data > touch_value){
		insert(touch_value, curr->left);
	}else{
		insert(touch_value, curr->right);
	}
	
}

void Tree::insertWrapper(int touch_value){ // wrapper function to reset curr 
	// Need an exact duplicate of the object, but pointing to diff address locations
	
	insert(touch_value,root);
	curr = root;
	return;
}


int Tree::recur(Node* node, int k){
    // base case
    if (node == nullptr) {
        return 0;
    }
 
    // recur for the left and right child with the revised target
    // if the target is reached, increment the path count
    return (k == node->data ? 1: 0) +
        recur(node->left, k - node->data) +
        recur(node->right, k - node->data);
}
 
// Function to count the total paths in a binary tree whose sum of all nodes equals `k`
int Tree::countPaths(Node* node, int k){
    // base case
    if (node == nullptr) {
        return 0;
    }
 
    // get the total number of paths with sum `k`, starting from the current node
    int count = recur(node, k);
 
    // return the number of paths with sum `k` that begin with the current node,
    // or any of its for children
    return count + countPaths(node->left, k) + countPaths(node->right, k);
}

int Tree::countPathsWrapper(int key){
	return countPaths(root,key);
}


